    font-size: 2rem;
    font-weight: 600;
    justify-items: center;
    padding: 2rem;
    margin: 0 auto;
    gap: 10rem 2rem;
  }
  
  .individu {
    grid-template-rows: 1fr 1fr 1fr 1fr;
    justify-items: center;
  }
  
  @media screen and (min-width: 768px) {
    .equipe {
      grid-template-rows: repeat(auto-fit, minmax(10rem, 1fr));
    }
  }
  @media screen and (min-width: 1024px) {
    .equipe {
      grid-template-columns: repeat(2, 1fr);
      grid-template-rows: repeat(3, 1fr);
    }
  }
  @media screen and (min-width: 1400px) {
    .equipe {
      grid-template-columns: repeat(3, 1fr);
      grid-template-rows: repeat(2, 1fr);
    }
  }
  
  .Nom {
    background-color: var(--color-headings);
    color: #fff;
  }
  
  .card--equipe .card__header {
    width: 100%;
    margin-top: 0;
    text-align: center;
    max-height: 84px;
  }
  
  .card--equipe {
    width: 425px;
    text-align: center;
  }
  
  .Rencontre {
    text-align: center;
    padding: 3rem 0;
    border-top: solid 2rem white;
  }
  
  .Rencontre > h2 {
    color: var(--color-primary);
  }
  
  * {
    box-sizing: border-box;
  }
  
  form {
    width: 100%;
    padding: 2rem;
    margin: auto;
  }
  @media screen and (min-width: 768px) {
    form {
      width: 50%;
    }
  }
  
  .mb-3 {
    margin-bottom: 3rem;
  }
  
  .phone-number {
    display: grid;
    grid-template-columns: 1fr 1fr 2fr;
    gap: 3rem;
  }
  
  .mb-3 > h2 {
    margin-bottom: 1rem;
    font-size: 2rem;
  }
  
  .mb-3 > p {
    margin-top: -1rem;
    margin-bottom: 1rem;
    font-size: 1.5rem;
    line-height: 1.2;
    color: #ccc;
  }
  
  .grid--1x2 form {
    width: 100%;
  }
  
  /* ---------------------------------------------------- Témoignage ---------------------------------------------------*/
  /* Slideshow container */
  .slideshow-container {
    max-width: 1000px;
    width: 100%;
    height: 300px;
    position: relative;
    margin: auto;
    background: var(--color-primary);
    top: 30px;
    border-radius: 50px;
  }
  
  /* Hide the images by default */
  .mySlides {
    display: none;
  }
  
  /* Next & previous buttons */
  .prev,
  .next {
    cursor: pointer;
    position: absolute;
    top: 50%;
    width: auto;
    margin-top: -22px;
    padding: 16px;
    color: #fff;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
  }
  .prev--yellow,
  .next--yellow {
    cursor: pointer;
    position: absolute;
    top: 170%;
    width: auto;
    margin-top: -22px;
    padding: 16px;
    color: #000;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
  }
  
  /* Position the "next button" to the right */
  
  .next {
    right: 0px;
    border-radius: 3px 0 0 3px;
  }
  
  .prev {
    left: 0px;
  }
  
  .next--yellow {
    right: 750px;
    border-radius: 3px 0 0 3px;
  }
  
  .prev--yellow {
    left: 0px;
  }
  /* On hover, add a black background color with a little bit see-through */
  .prev:hover,
  .next:hover {
    background-color: var(--color-accent);
  }
  
  /* Number text (1/3 etc) */
  .numbertext {
    color: #f2f2f2;
    font-size: 2rem;
    padding: 8px 0px;
    position: absolute;
    bottom: 0;
    font-weight: 700;
    right: 10%;
  }
  
  /* The dots/bullets/indicators */
  .dot {
    cursor: pointer;
    height: 15px;
    width: 15px;
    margin: 0 2px;
    background-color: #bbb;
    border-radius: 50%;
    display: inline-block;
    transition: background-color 0.6s ease;
    top: 150px;
    position: relative;
  }
  
  .active,
  .dot:hover {
    background-color: #717171;
  }
  
  /* Fading animation */
  .fade {
    -webkit-animation-name: fade;
    -webkit-animation-duration: 1.5;
    animation-name: fade;
    animation-duration: 1.5s;
  }
  
  @-webkit-keyframes fade {
    from {
      opacity: 0.4;
    }
    to {
      opacity: 1;
    }
  }
  
  @keyframes fade {
    from {
      opacity: 0.4;
    }
    to {
      opacity: 1;
    }
  }
  
  .temoignage {
    padding: 30px 0;
  }
  #témoignage-visible {
    opacity: 1;
  }
  .icon-visible {
    opacity: 1;
  }
  
  .temoignage--header {
    padding-top: 50px;
  }
  
  @media screen and (min-width: 1024px) {
    .numbertext {
      right: 50%;
    }
  
    .temoignage {
      padding: 40px;
    }
  }
  
  /* --------------------------------------------------------------- Quotes --------------------------------------------------------------- */
  
  .quote__text {
    text-align: center;
    color: #fff;
  }
  
  .quote__text::before {
    content: open-quote;
  }
  
  .quote__text::after {
    content: close-quote;
  }
  
  .quote__author {
    position: absolute;
    bottom: 0;
    left: 30px;
    color: #fff;
  }
  
  @media screen and (min-width: 1024px) {
    .quote__author {
      font-size: 2.4rem;
    }
  }
  
  @media screen and (min-width: 768px) {
    .services:nth-of-type(even) .text--services {
      order: 2;
    }
  }
  
  #scrollToTopBtn {
    background-color: var(--color-primary);
    border: none;
    border-radius: 24px;
    color: white;
    cursor: pointer;
    font-size: 18px;
    line-height: 48px;
    width: 48px;
    height: 48px;
    position: fixed;
    bottom: 20px;
    right: 20px;
    padding: 0;
  }
  
  #override-milligram {
    max-width: none;
  }
  
  #button-override:hover {
    background-color: var(--color-primary);
    border: 1px solid white;
  }
  
  .navbar-toggler {
    height: 3.8rem;
  }
  
  #navbarDropdownMenuLink:focus {
    color: #fff;
  }
  
  .flex {
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    justify-content: center;
  }
  @media screen and (max-width: 575px) {
    .header--small {
      font-size: 25px;
    }
  }
  
  .block--coco {
    background-color: rgb(254, 255, 170);
    padding-bottom: 10rem;
  }
  
  .img {
    width: 100%;
  }
  
  @-webkit-keyframes spaceboots {
    0% {
      -webkit-transform: rotate(0deg);
    }
    5% {
      -webkit-transform: translateX(-5px) rotate(-30deg);
    }
  
    10% {
      -webkit-transform: translateX(5px) rotate(30deg);
    }
    15% {
      -webkit-transform: rotate(-0deg);
    }
  
    100% {
      -webkit-transform: rotate(0deg);
    }
  }
  #scrollToTopBtn {
    -webkit-animation-name: spaceboots;
    -webkit-animation-duration: 3s;
    -webkit-transform-origin: 50% 50%;
    -webkit-animation-iteration-count: infinite;
    -webkit-animation-timing-function: linear;
  }
  
  .image-flip:hover .backside,
  .image-flip.hover .backside {
    -webkit-transform: rotateY(0deg);
    -moz-transform: rotateY(0deg);
    -o-transform: rotateY(0deg);
    -ms-transform: rotateY(0deg);
    transform: rotateY(0deg);
    border-radius: 0.25rem;
  }
  
  .image-flip:hover .frontside,
  .image-flip.hover .frontside {
    -webkit-transform: rotateY(180deg);
    -moz-transform: rotateY(180deg);
    -o-transform: rotateY(180deg);
    transform: rotateY(180deg);
  }
  
  .mainflip {
    -webkit-transition: 1s;
    -webkit-transform-style: preserve-3d;
    -ms-transition: 1s;
    -moz-transition: 1s;
    -moz-transform: perspective(1000px);
    -moz-transform-style: preserve-3d;
    -ms-transform-style: preserve-3d;
    transition: 1s;
    transform-style: preserve-3d;
  }
  
  .frontside {
    position: relative;
    -webkit-transform: rotateY(0deg);
    -ms-transform: rotateY(0deg);
    z-index: 2;
    margin-bottom: 30px;
  }
  
  .backside {
    border-radius: 32px;
    position: absolute;
    top: 0;
    left: 0;
  
    -webkit-transform: rotateY(-180deg);
    -moz-transform: rotateY(-180deg);
    -o-transform: rotateY(-180deg);
    -ms-transform: rotateY(-180deg);
    transform: rotateY(-180deg);
    -webkit-box-shadow: 5px 7px 9px -4px rgb(158, 158, 158);
    -moz-box-shadow: 5px 7px 9px -4px rgb(158, 158, 158);
    box-shadow: 5px 7px 9px -4px rgb(158, 158, 158);
  }
  
  .frontside,
  .backside {
    -webkit-backface-visibility: hidden;
    -moz-backface-visibility: hidden;
    -ms-backface-visibility: hidden;
    backface-visibility: hidden;
    -webkit-transition: 1s;
    -webkit-transform-style: preserve-3d;
    -moz-transition: 1s;
    -moz-transform-style: preserve-3d;
    -o-transition: 1s;
    -o-transform-style: preserve-3d;
    -ms-transition: 1s;
    -ms-transform-style: preserve-3d;
    transition: 1s;
    transform-style: preserve-3d;
  }
  
  .frontside .card,
  .backside .card {
    min-height: 516px;
    width: 425px;
  }
  
  #override--card {
    background-color: white;
    border-radius: 38px;
    overflow: hidden;
  }
  
  .align {
    padding: 2rem;
  }
  
  .text-CHU {
    color: #ff3678;
  }
  
  .background-CHU {
    background-color: #d1f8ff;
  }
  
  .center--arrow {
    bottom: 28%;
    right: 28%;
    position: relative;
  }
  .milligram-override {
    color: var(--color-headings);
  }
  
  .fade:not(.show) {
    opacity: 1;
  }
  .allo {
    color: black;
  }

