:root {
    --color-primary: #147db0;
    --color-secondary: #00d9ff;
    --color-accent: #ffee00;
  
    --color-headings: #2584ff;
    --color-body: #918ca4;
    --color-body-darker: #5c5577;
    --color-border: #ccc;
    --border-radius: 30px;
    --color-gris: rgb(227 224 213 / 49%);
  }
  
  *,
  *::after,
  *::before {
    box-sizing: border-box;
  }
  html {
    font-size: 62.5%;
  }
  /* --------------------------------------------------------------- Typography --------------------------------------------------------------- */
  ::selection {
    background-color: var(--color-primary);
    color: #fff;
  }
  
  body {
    font-family: Inter, sans-serif;
    font-size: 2.4rem;
    line-height: 1.5;
    color: var(--color-body);
  }
  
  h1,
  h2,
  h3 {
    color: var(--color-primary);
    margin-bottom: 1rem;
    line-height: 1.1;
  }
  
  h1 {
    font-size: 7rem;
  }
  
  h2 {
    font-size: 4rem;
    font-weight: 700;
  }
  h3 {
    font-size: 3rem;
    font-weight: 500;
  }
  
  p {
    margin-top: 0;
    color: var(--color-primary);
    line-height: 2;
    letter-spacing: 1.5px;
  }
  
  @media screen and (min-width: 1024px) {
    body {
      font-size: 1.8rem;
    }
  
    h1 {
      font-size: 8rem;
    }
    h2 {
      font-size: 4rem;
    }
    h3 {
      font-size: 2.4rem;
    }
  }
  
  a {
    text-decoration: none;
  }
  
  /* --------------------------------------------------------------- Lists --------------------------------------------------------------- */
  
  .list {
    list-style: none;
    padding-left: 0;
  }
  
  .list--inline .list__item {
    display: inline-block;
    margin-right: 2rem;
  }
  
  .list--tick {
    list-style-image: url(../images/goutte.svg);
    padding-left: 3rem;
    color: var(--color-headings);
  }
  
  .list--tick--CHU {
    list-style-image: url(../images/Coeur.svg);
    padding-left: 6rem;
    color: #ff3678;
  }
  .list--tick--ig {
    list-style-image: url(../images/instagram--primary.svg);
    padding-left: 6rem;
    color: #ff3678;
  }
  .list--tick--fb {
    list-style-image: url(../images/facebook--primary.svg);
    padding-left: 6rem;
    color: #ff3678;
  }
  
  .list--tick .list__item {
    padding-left: 0.5rem;
    margin-bottom: 1rem;
  }
  
  @media screen and (min-width: 1024px) {
    .list--tick .list__item {
      padding-left: 0%;
    }
  }
  
  /* --------------------------------------------------------------- Buttons --------------------------------------------------------------- */
  
  .btn {
    border-radius: 40px;
    border: 0;
    cursor: pointer;
    font-size: 1.8rem;
    font-weight: 600;
    outline: 0;
    margin: 1rem 0;
    padding: 2rem 3rem;
    text-align: center;
    text-transform: uppercase;
    white-space: nowrap;
  }
  
  .btn .icon {
    width: 2rem;
    height: 2rem;
    margin-right: 1rem;
    vertical-align: middle;
  }
  .btn--primary {
    background-color: var(--color-primary);
    color: #fff;
  }
  .btn--primary:hover {
    background: #3a8ffd;
  }
  
  .btn--secondary {
    background-color: var(--color-secondary);
    color: #fff;
  }
  .btn--secondary:hover {
    background: #00c8eb;
  }
  .btn--accent {
    font-size: 18px;
    padding: 15px 30px;
    border-radius: 30px;
    text-decoration: none;
    display: inline-block;
    text-transform: uppercase;
    background-color: #fff;
    border: 0;
    outline: 0;
    box-shadow: 0 5px 10px 0 rgba(205, 209, 215, 0.8);
    color: #afb4bb;
    background: linear-gradient(to left, var(--color-headings), #16bffd);
    color: #fff;
    animation: gradient 5s ease infinite;
    background-size: 300% 300%;
  }
  
  .btn--submit {
    padding: 8px 30px;
  }
  
  @keyframes gradient {
    0% {
      background-position: 0% 50%;
    }
    50% {
      background-position: 100% 50%;
    }
    100% {
      background-position: 0% 50%;
    }
  }
  
  .btn--yellow {
    font-size: 18px;
    padding: 15px 30px;
    border-radius: 30px;
    text-decoration: none;
    display: inline-block;
    text-transform: uppercase;
    background-color: #fff;
    border: 0;
    outline: 0;
    box-shadow: 0 5px 10px 0 rgba(205, 209, 215, 0.8);
    color: #afb4bb;
    background: linear-gradient(to left, rgb(255, 208, 0), rgb(255, 0, 76));
    color: #fff;
    animation: gradient 5s ease infinite;
    background-size: 300% 300%;
  }
  
  @keyframes gradient {
    0% {
      background-position: 0% 50%;
    }
    50% {
      background-position: 100% 50%;
    }
    100% {
      background-position: 0% 50%;
    }
  }
  
  .center--btn {
    display: block;
    margin: auto;
  }
  .btn--block {
    width: 100%;
    display: inline-block;
  }
  .btn--outline {
    background: #fff;
    color: var(--color-headings);
    border: 2px solid var(--color-headings);
  }
  
  .btn--bottom {
    margin: auto;
    width: 100%;
    padding: 3rem;
  }
  
  .btn--stretch {
    padding-left: 6rem;
    padding-right: 6rem;
  }
  
  .btn--outline:hover {
    background: var(--color-headings);
    color: #fff;
  }
  
  @media screen and (min-width: 1024px) {
    .btn {
      font-size: 1.5rem;
    }
  }
  
  /* --------------------------------------------------------------- Cards --------------------------------------------------------------- */
  
  .card {
    border-radius: 30px;
    box-shadow: 0 0 20px 10px #f3f3f3;
    overflow: hidden;
  }
  
  .card__header,
  .card__body {
    padding: 2rem;
  }
  
  .plan .card__header {
    padding: 1rem 2rem;
  }
  
  .plan .card__body {
    padding: 0 2rem;
  }
  
  .card--primary .card__header {
    background: var(--color-primary);
    color: #fff;
    height: 190px;
  }
  
  .card--secondary .card__header {
    background: var(--color-secondary);
    color: #fff;
    height: 190px;
  }
  
  .card--secondary .badge--secondary {
    background: #02cdf1;
  }
  
  .card--primary .badge--primary {
    background: #126de4;
  }
  /* --------------------------------------------------------------- Plans --------------------------------------------------------------- */
  .plan {
    transition: transform 1s ease-out;
    padding-top: 5rem;
  }
  .plan__name {
    color: #fff;
    margin: 0;
    text-align: center;
    font-weight: 700;
    font-size: 2.4rem;
  }
  
  .plan__price {
    font-size: 5rem;
  }
  
  .plan__billing-cycle {
    font-size: 2.4rem;
    font-weight: 700;
    opacity: 0.8;
    margin-right: 1rem;
  }
  
  .plan__description {
    font-size: 2rem;
    font-weight: 300;
    letter-spacing: 1px;
    display: block;
  }
  
  .plan .list__item {
    margin-bottom: 2rem;
    letter-spacing: 1px;
  }
  
  .plan:hover {
    transform: scale(1.05);
  }
  
  @media screen and (min-width: 1024px) {
    .plan__unknown {
      justify-items: center;
      font-size: 3rem;
      margin-top: 1rem;
      margin-bottom: 1rem;
    }
  
    .plan__name {
      font-size: 2rem;
    }
  
    .plan__price {
      font-size: 5rem;
    }
  
    .plan__billing-cycle {
      font-size: 1.6rem;
    }
  
    .plan__description {
      font-size: 1.7rem;
    }
  }
  
  /* --------------------------------------------------------------- Media --------------------------------------------------------------- */
  
  .media {
    display: flex;
  }
  
  .media__title {
    margin-top: 0;
  }
  
  .media__body {
    margin: 0 2rem;
    margin-bottom: 4rem;
  }
  
  .media__image {
    margin-top: 1rem;
  }
  
  /* --------------------------------------------------------------- Grids --------------------------------------------------------------- */
  
  .grid {
    display: grid;
  }
  
  @media screen and (min-width: 1024px) {
    .grid--1x2 {
      grid-template-columns: 1fr 1fr;
    }
    .grid-left {
      grid-template-columns: 2fr 1fr;
    }
    .grid--1x3 {
      grid-template-columns: 1fr 1fr 1fr;
    }
  }
  
  /* --------------------------------------------------------------- Grids --------------------------------------------------------------- */
  .testimonial {
    padding: 4rem;
  }
  
  .testimonial__image {
    position: relative;
  }
  
  .testimonial__image > .icon-container {
    position: absolute;
    top: 3rem;
    right: -32px;
  }
  
  @media screen and (min-width: 768px) {
    .testimonial .quote,
    .testimonial .quote__author {
      font-size: 2.4rem;
    }
  
    .testimonial .quote {
      margin-left: 6rem;
    }
  }
  
  /* --------------------------------------------------------------- Callouts --------------------------------------------------------------- */
  
  .callout {
    padding: 4rem;
    border-radius: 5px;
  }
  .callout--primary {
    background: var(--color-primary);
    color: #fff;
  }
  
  .callout__heading {
    color: #fff;
    margin-top: 0;
    font-size: 3rem;
  }
  
  .callout .btn {
    justify-self: center;
    align-self: center;
  }
  
  .callout__content {
    text-align: center;
  }
  
  @media screen and (min-width: 768px) {
    .callout .grid--1x2 {
      grid-template-columns: 1fr auto;
    }
  
    .callout__content {
      text-align: left;
    }
  
    .callout .btn {
      justify-self: start;
      margin: 0 2rem;
    }
  }
  /* --------------------------------------------------------------- Collapsible --------------------------------------------------------------- */
  
  .collapsible__header {
    display: flex;
    justify-content: space-between;
  }
  
  .collapsible__heading {
    margin-top: 0;
    font-size: 3rem;
  }
  
  .collapsible__chevron {
    transform: rotate(-90deg);
  }
  
  .collapsible__content {
    max-height: 0;
    overflow: hidden;
    opacity: 0;
    transition: all 0.3s;
  }
  
  .collapsible--expanded .collapsible__chevron {
    transform: rotate(0);
  }
  
  .collapsible--expanded .collapsible__content {
    max-height: 100vh;
    opacity: 1;
  }
  
  /* --------------------------------------------------------------- Blocks --------------------------------------------------------------- */
  
  .block__header {
    padding-top: 30px;
    text-align: center;
    margin-bottom: 4rem;
  }
  
  .block__heading {
    margin-top: 0;
    margin-bottom: 20px;
  }
  
  .block--beige {
    background-color: var(--color-primary);
    background-size: 50%;
    border-radius: 50px;
  }
  .block--intro {
    background-image: url(../images/cadrages.jpg);
    background-repeat: no-repeat;
    background-size: cover;
    object-fit: cover;
    color: #7b858b;
  }
  .block--intro h1,
  .block--intro h2,
  .block--intro h3 {
    color: white;
  }
  
  .block--propos {
    background-image: url(../images/cadrage.jpg);
    background-repeat: no-repeat;
    background-size: cover;
    object-fit: cover;
    color: #7b858b;
  }
  
  .container__card {
    max-width: 1700px;
    margin: 0 10px;
  }
  
  .container__heading {
    max-width: 1700px;
    margin: 0 50px;
  }
  
  .container__feature {
    max-width: 1700px;
    margin: 0 10px;
  }
  /* TODO */
  @media screen and (max-width: 660px) {
    .block--dark {
      background-image: url(../images/cadrage.jpg);
    }
  }
  
  @media screen and (min-width: 760px) {
    .container__feature {
      max-width: 1700px;
      margin: 0 70px;
    }
  }
