  /* ---------------------------------------------------- Témoignage ---------------------------------------------------*/
  /* Slideshow container */
  .slideshow-container {
    max-width: 1000px;
    width: 100%;
    height: 300px;
    position: relative;
    margin: auto;
    background: var(--color-primary);
    top: 30px;
    border-radius: 50px;
  }
  
  /* Hide the images by default */
  .mySlides {
    display: none;
  }
  
  /* Next & previous buttons */
  .prev,
  .next {
    cursor: pointer;
    position: absolute;
    top: 50%;
    width: auto;
    margin-top: -22px;
    padding: 16px;
    color: #fff;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
  }
  .prev--yellow,
  .next--yellow {
    cursor: pointer;
    position: absolute;
    top: 170%;
    width: auto;
    margin-top: -22px;
    padding: 16px;
    color: #000;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
  }
  
  /* Position the "next button" to the right */
  
  .next {
    right: 0px;
    border-radius: 3px 0 0 3px;
  }
  
  .prev {
    left: 0px;
  }
  
  .next--yellow {
    right: 750px;
    border-radius: 3px 0 0 3px;
  }
  
  .prev--yellow {
    left: 0px;
  }
  /* On hover, add a black background color with a little bit see-through */
  .prev:hover,
  .next:hover {
    background-color: var(--color-accent);
  }
  
  /* Number text (1/3 etc) */
  .numbertext {
    color: #f2f2f2;
    font-size: 2rem;
    padding: 8px 0px;
    position: absolute;
    bottom: 0;
    font-weight: 700;
    right: 10%;
  }
  
  /* The dots/bullets/indicators */
  .dot {
    cursor: pointer;
    height: 15px;
    width: 15px;
    margin: 0 2px;
    background-color: #bbb;
    border-radius: 50%;
    display: inline-block;
    transition: background-color 0.6s ease;
    top: 150px;
    position: relative;
  }
  
  .active,
  .dot:hover {
    background-color: #717171;
  }
  
  /* Fading animation */
  .fade {
    -webkit-animation-name: fade;
    -webkit-animation-duration: 1.5;
    animation-name: fade;
    animation-duration: 1.5s;
  }
  
  @-webkit-keyframes fade {
    from {
      opacity: 0.4;
    }
    to {
      opacity: 1;
    }
  }
  
  @keyframes fade {
    from {
      opacity: 0.4;
    }
    to {
      opacity: 1;
    }
  }
  
